window.bookSummaryJSON = "<p>My magic, my rules.</p> <p>I’m the Aether Witch.</p> <p>And I’m done playing this game.</p> <p>We’re running blind toward a target we can’t see. Everything I love is on the line. My magic. My family. My Coven. Tennessee. I’ll lose it all at the strike of midnight on Samhain if I don’t put the pieces of this puzzle together.</p> <p>Salem’s Prophecy says the fate of the world lies on mine and my twin’s hands. Despite our Coven-mates thriving power and Heavenly intentions...In the end, the task is ours. And ours alone. If we fail, terror and chaos will rain down on our realm so severe no one will be able to fight it. This is the battle of a lifetime - and the demons are attacking with everything they’ve got.</p> <p>But I’m going to end this, even if I have to burn this city to the ground to do it.</p> <p>The magic continues in <i>The Aether Witch</i>, the sixth book in the adventure-filled Elemental Magic series that’s leaving listeners begging for more!</p>"; 
